						  TrUserData);
      24 ->
	  'd_field_Etcd.ResponseHeader_revision'(Rest, 0, 0, F@_1,
						 F@_2, F@_3, F@_4, TrUserData);
      32 ->
	  'd_field_Etcd.ResponseHeader_raft_term'(Rest, 0, 0,
						  F@_1, F@_2, F@_3, F@_4,
						  TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		'skip_varint_Etcd.ResponseHeader'(Rest, 0, 0, F@_1,
						  F@_2, F@_3, F@_4, TrUserData);
	    1 ->
