					      F@_3, F@_4, TrUserData);
	    2 ->
		'skip_length_delimited_Etcd.ResponseHeader'(Rest, 0, 0,
							    F@_1, F@_2, F@_3,
							    F@_4, TrUserData);
	    3 ->
		'skip_group_Etcd.ResponseHeader'(Rest, Key bsr 3, 0,
						 F@_1, F@_2, F@_3, F@_4,
						 TrUserData);
	    5 ->
		'skip_32_Etcd.ResponseHeader'(Rest, 0, 0, F@_1, F@_2,
					      F@_3, F@_4, TrUserData)
	  end
    end;
