				       F@_2, TrUserData);
'dfp_read_field_def_Etcd.PutResponse'(<<>>, 0, 0, F@_1,
				      F@_2, _) ->
    S1 = #{},
    S2 = if F@_1 == '$undef' -> S1;
	    true -> S1#{header => F@_1}
	 end,
    if F@_2 == '$undef' -> S2;
       true -> S2#{prev_kv => F@_2}
    end;
'dfp_read_field_def_Etcd.PutResponse'(Other, Z1, Z2,
				      F@_1, F@_2, TrUserData) ->
