'dg_read_field_def_Etcd.PutResponse'(<<1:1, X:7,
				       Rest/binary>>,
				     N, Acc, F@_1, F@_2, TrUserData)
    when N < 32 - 7 ->
    'dg_read_field_def_Etcd.PutResponse'(Rest, N + 7,
