			   Len = X bsl N + Acc,
			   <<Bs:Len/binary, Rest2/binary>> = Rest,
			   {id('decode_msg_Etcd.ResponseHeader'(Bs, TrUserData),
			       TrUserData),
			    Rest2}
			 end,
    'dfp_read_field_def_Etcd.PutResponse'(RestF, 0, 0,
					  if Prev == '$undef' -> NewFValue;
					     true ->
						 'merge_msg_Etcd.ResponseHeader'(Prev,
										 NewFValue,
										 TrUserData)
					  end,
					  F@_2, TrUserData).

